INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (0.0, "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", 2.1, "2030/01/01 14:59:59", 3001100, 1, "2024/10/31 12:00:00", -416.5, 130011, 2, 3001, 100, "ヤマト");
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (0.0, "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", 5.68, "2030/01/01 14:59:59", 3001101, 4, "2024/10/31 12:00:00", -416.5, 130011, 2, 3001, 101, "ヤマト");
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (0.0, "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", 0.0, "2030/01/01 14:59:59", 3001102, 1, "2024/10/31 12:00:00", -416.5, 130011, 1, 3001, 102, "ヤマト");
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (0.0, "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", 0.0, "2030/01/01 14:59:59", 3002100, 1, "2024/10/31 12:00:00", -416.5, 130211, 1, 3002, 100, "フブキ");
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (0.0, "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", 0.0, "2030/01/01 14:59:59", 3002101, 1, "2024/10/31 12:00:00", -416.5, 130211, 1, 3002, 101, "フブキ");
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (0.0, "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", 8.53, "2030/01/01 14:59:59", 3002102, 5, "2024/10/31 12:00:00", -416.5, 130211, 2, 3002, 102, "フブキ");
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (0.0, "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", 5.67, "2030/01/01 14:59:59", 3002103, 7, "2024/10/31 12:00:00", -416.5, 130211, 1, 3002, 103, "フブキ");
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (0.0, "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", 0.0, "2030/01/01 14:59:59", 3002104, 1, "2024/10/31 12:00:00", -416.5, 130211, 1, 3002, 104, "フブキ");
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (0.0, "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", 0.0, "2030/01/01 14:59:59", 3002300, 3, "2024/10/31 12:00:00", -416.5, 130211, 3, 3004, 300, "フブキ");
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (0.0, "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", 0.0, "2030/01/01 14:59:59", 3002400, 7, "2024/10/31 12:00:00", -416.5, 130211, 7, 3005, 301, "フブキ");
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (0.0, "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪", 4.4, "2030/01/01 14:59:59", 3003200, 2, "2024/10/31 12:00:00", -416.5, 130211, 1, 3003, 200, "フブキ");
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (0.0, "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ", 0.0, "2030/01/01 14:59:59", 3003201, 7, "2024/10/31 12:00:00", -416.5, 130211, 7, 3003, 201, "フブキ");
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (0.0, "お兄さんってば、ぼくがいないと\nほんとザッコザコだよね～\nもっと感謝しろし～♪", 5.6, "2030/01/01 14:59:59", 3003202, 1, "2024/10/31 12:00:00", -416.5, 130211, 2, 3003, 202, "フブキ");
